AFTER DELETE ON osoba 
FOR EACH ROW 
BEGIN 
DELETE FROM hobby WHERE OLD.id = hobby.osoba;
UPDATE zwierzak SET ownerID = (FLOOR(RAND() * (SELECT MAX(id) FROM osoba) + 1)) WHERE ownerID = OLD.id;
END */;;
